We use the distance formula:  \begin{align*}
\sqrt{(2 - (-4))^2 + ((-6) - 3)^2} &= \sqrt{6^2 + (-9)^2}\\
& = \sqrt{36 + 81}\\
& = \sqrt{117} = \boxed{3\sqrt{13}}.
\end{align*}

messages.content:
To find the distance between the points \((2, -6)\) and \((-4, 3)\), we use the **distance formula**:

\[
\text{Distance} = \sqrt{(x_2 - x_1)^2 + (y_2 - y_1)^2}
\]

Substitute the coordinates:

\[
x_1 = 2,\quad y_1 = -6,\quad x_2 = -4,\quad y_2 = 3
\]

\[
\text{Distance} = \sqrt{(-4 - 2)^2 + (3 - (-6))^2}
= \sqrt{(-6)^2 + (9)^2}
= \sqrt{36 + 81}
= \sqrt{117}
\]

Simplify \(\sqrt{117}\):

\[
\sqrt{117} = \sqrt{9 \cdot 13} = 3\sqrt{13}
\]

Answer: 3√13

