Name the points $A(5,3)$, $B(6,8)$, $C(7,4)$, and $D(x,y)$ and sketch the first three.  We find that there are three possible locations for $D$ (see figure).  Only the one to the right has an $x$-coordinate greater than 7.  Since $AC$ is parallel to $BD$ and equal in length to it, $D$ is two units to the right and one unit up from $B$, just as $C$ is two units to the right and one unit up from $A$.  Therefore, the coordinates of $D$ are $(8,9)$, and $x+y=8+9=\boxed{17}$.

[asy]
size(5cm);
import graph;
